import CustomBtn from "./CustomBtn";

const List = (props) => {
  return (
    <div>
      <div>{props.list.title}</div>
      <div>{props.list.todo}</div>
      <CustomBtn
        onClick={() => {
          console.log("삭제");
          props.delete(props.list.id);
        }}
      >
        삭제하기
      </CustomBtn>
      <CustomBtn
        onClick={() => {
          props.done(props.list.id);
        }}
      >
        {props.list.isDone ? "취소" : "완료"}
      </CustomBtn>
    </div>
  );
};

export default List;
